import React from 'react';
import './Card.css'; // vamos criar esse arquivo com o CSS

export default function Card() {
  return (
    <div className="card">
      <div className="card-details">
        <p className="text-title">Projetos</p>
        <p className="text-body">Confira meus projetos recentes.</p>
      </div>
      <button className="card-button">Ver Mais</button>
    </div>
  );
}
